#include "MenuOptions.h"

MenuOptions::MenuOptions(const Vei2& pos)
{
	auto Pos = pos;

	int count = 0;

		for (int y = 0; y < 4; y++)
		{
			Vei2 Pos;

			for (int x = 0; x < 3; x++)
			{
				Pos.y = (y * highlightHeight) + pos.y;
				Pos.x = (x * (highlightWidth * 2)) + pos.x;

				buttons[count] = { Pos };
				count++;
			}
		}
	

}

void MenuOptions::ProcessMouse(const Mouse::Event& e)
{
	switch (e.GetType())
	{
	case Mouse::Event::Type::Move:

		for (auto& b : buttons)
		{
			if (b.madeContact(e.GetPos()))
			{
				b.SetContact();
			}
			else
			{
				b.resetContact();
			}
		}

		Resetcontacts();
		break;
	default:
	{
		break;
	}

	}
}

void MenuOptions::Resetcontacts()
{
	for (auto& b : buttons)
	{
		b.resetContact();
	}
}

void MenuOptions::Draw(Graphics& gfx)
{
	
	Projection(Vei2(140, 120), gfx );
	Vei2 pos{ 200, 158 };
	for (int i = 0; i < maxhighlight; i++)
	{
		buttons[i].Draw(gfx);
	}
	Menuart(Vei2(140, 120), gfx);
}

