bool MenuOptions::button::madeContact(const Vei2& pos)
{
	return rect.Contains(pos);
}

void MenuOptions::button::resetContact()
{
	contacted = false;
}

void MenuOptions::button::SetContact()
{
	contacted = true;
}

bool MenuOptions::button::isContacted()
{
	return contacted;
}
